import Logo from '@/components/tools/Logo'
import SMenu from './index'
import { mixin, mixinDevice } from '@/utils/mixin'

export default {
  name: 'SideMenu',
  components: { Logo, SMenu },
  mixins: [mixin, mixinDevice],
  props: {
    mode: {
      type: String,
      required: false,
      default: 'inline'
    },
    theme: {
      type: String,
      required: false,
      default: 'dark'
    },
    collapsible: {
      type: Boolean,
      required: false,
      default: false
    },
    collapsed: {
      type: Boolean,
      required: false,
      default: false
    },
    menus: {
      type: Array,
      required: true
    }
  },
  data(){
    return{
      selectKeys: ["Dashboard"]
    }
  },
  watch:{
    $route(){
      this.selectKeys = [this.$route.name]
    }
  },
  methods: {
    onSelect (obj) {
     this.$router.push({name: obj.key})
    }
  },
  created() {
    this.selectKeys = [this.$route.name]
  }
}
